import React from "react";
import logo from "./logo.svg";
import "./App.css";
import SSEProgress from "./components/SSEProgress";

function App() {
  const handleComplete = () => {
    console.log("任务已完成!");
  };

  const handleError = (error: Error) => {
    console.error("任务出错:", error.message);
  };
  return (
    <div className="App">
      <h1>SSE 进度演示</h1>
      <SSEProgress />
    </div>
  );
}

export default App;
